import React from 'react';
import { Link } from 'react-router-dom';
import './style.css';

import PrevPage from '../../components/PrevPage';
import Chatbot from 'react-chatbot-kit';
import Exp from '../../components/Exp';

import ActionProvider from "../../components/Chatbot/ActionProvider";
import MessageParser from "../../components/Chatbot/MessageParser";
import config from "../../components/Chatbot/config";





export default class Work extends React.Component {

  constructor() {
    super();
    this.state = {
      nomeBotao: 'Esconder',
      chatContainer: 'show'
    }
  }

  alterarEstado() {
    var state;
    var btn_chat;
    if (this.state.classeDiv === 'show') {
      state = "hide";
      btn_chat = 'Mostrar';
    } else {
      state = "show";
      btn_chat = 'Esconder';
    }
    this.setState({
      state: btn_chat,
      btn_chat: state
    })
  }
  render() {

    return (
      <div className="work">
        <div className="DivBotao">
                <button onClick={this.props.funcao} className="Botao">{this.props.valor}</button>
        </div>

        <div className="style-bars" id="top-bar_w" />
        <div className="style-bars" id="bottom-bar_w" />

        <Link to="/">
          <PrevPage />
        </Link>

        <div className="chat-container">
          <Chatbot
            config={config}
            actionProvider={ActionProvider}
            messageParser={MessageParser}
            headerText="VINIBOT - Informações extras"
          />
        </div>



        <Exp />


      </div>
    );
  }
}
